  state = {
    movies: getMovies()
  };

  render() {
    return (
      <div className="container">
        <h1>Hello world</h1>
        {this.renderMovieList()}
      </div>
    );
  }
  renderMovieList() {
    const { titles } = this.state.movies.filter(movie => movie.title);
    //return titles.map(title => <li>{title}</li>);
    console.log(titles);
  }
}

